import classes from './ProductModel.module.css';
import React from 'react';

const productModel = (props) => {
    return (
        <div className={classes.ProductModel}>
            <p>{props.name}</p>
            <p>{props.desc}</p>
            <p>{props.type}</p>
            <p>{props.price}</p>
        </div>
    )
}

export default productModel;
